const A="Microbiology Chapter 18 Homework",g="Homework questions for Microbiology Chapter 18.",I="Microbiology",C=[{id:"mc-ch18-hw-1",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 18",topic:"Adaptive Immunity",difficulty:"easy",question:"In 1796, Edward Jenner injected an 8 year old boy with material from  cowpox virus  in order to attempt to vaccinate him against small pox.",image:"data:image/jpeg;base64,",options:["True","False"],correctAnswer:0,explanation:"True. This famous experiment by Edward Jenner is considered the birth of vaccinology and demonstrated the principles of immunity."},{id:"mc-ch18-hw-2",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 18",topic:"Adaptive Immunity",difficulty:"easy",question:"If a person coughs, sneezes or has a fever, these are all signs that the immune system is not working.",image:"data:image/jpeg;base64,",options:["True","False"],correctAnswer:1,explanation:"False. These are symptoms indicating that the immune system is actively responding to and fighting off a pathogen."},{id:"mc-ch18-hw-3",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 18",topic:"Adaptive Immunity",difficulty:"easy",question:"B cells and T cells are part of the adaptive immune response",image:"data:image/jpeg;base64,",options:["True","False"],correctAnswer:0,explanation:"True. B and T lymphocytes are the key players in the adaptive immune system, responsible for specific pathogen recognition and immunological memory."},{id:"mc-ch18-hw-4",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 18",topic:"Adaptive Immunity",difficulty:"easy",question:"Live attenuated vaccines are made of the pathogen itself only weaker.",image:"data:image/jpeg;base64,",options:["True","False"],correctAnswer:0,explanation:"True. Live attenuated vaccines contain a version of the living virus or bacteria that has been weakened so that it does not cause serious disease in people with healthy immune systems."},{id:"mc-ch18-hw-5",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 18",topic:"Adaptive Immunity",difficulty:"easy",question:"Subunit vaccines are made of antigens, just a part of the pathogen.",image:"data:image/jpeg;base64,",options:["True","False"],correctAnswer:0,explanation:"True. Subunit vaccines include only the parts of a virus or bacteria that best stimulate the immune system, rather than the entire pathogen."}],v={name:A,description:g,subject:I,questions:C};export{v as default,g as description,A as name,C as questions,I as subject};
